package netty;
option java_package = "Jjd.messagePush.vo.user.resp";
option java_outer_classname = "FeedBackRespProto";

message FeedBackResp{
	required int64 state= 1;
	
	required string msg = 2;
	
	optional Result result = 3;
	
	message Result{
		optional string content= 1;
                optional string contact= 2;
	}

}